import { useEffect, useState } from "react";
import { connect, useDispatch } from "react-redux";
import base64toBlob from '../../helper/function/ConvertBase64ToUrl'
import {
    getModal,
    updateModal
  } from "../../redux/actions/Modal.Action"
// Core viewer
import { Viewer,Worker } from '@react-pdf-viewer/core';
import { defaultLayoutPlugin } from '@react-pdf-viewer/default-layout';
import { pageNavigationPlugin } from '@react-pdf-viewer/page-navigation';

// Import styles
import '@react-pdf-viewer/default-layout/lib/styles/index.css';
import '@react-pdf-viewer/page-navigation/lib/styles/index.css';
import '@react-pdf-viewer/core/lib/styles/index.css';

import { pdfjs } from 'react-pdf';
pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.min.js`;

function TestContent(props:any){
  
  const defaultLayoutPluginInstance = defaultLayoutPlugin();
  const pageNavigationPluginInstance = pageNavigationPlugin();

  const [url, setUrl] = useState<any>("");
  const pdfContentType = 'application/pdf';

  useEffect(() => {
      const base64 = 'data:application/pdf;base64, ';
      const url = URL.createObjectURL(base64toBlob(base64,pdfContentType));
      setUrl(url);
     
  }, []);


  return(
    <>
      <Worker workerUrl={pdfjs.GlobalWorkerOptions.workerSrc}>
            <div className="view-pdf" style={{height:"700px"}}>
              <Viewer
                    fileUrl={url}
                    plugins={[
                        defaultLayoutPluginInstance,
                    ]}
                />
            </div>           
     </Worker>   

     <button onClick={()=>props.updateModal({IsOpen:false,Content:null})}>hide modal</button>
    </>
  )
}


const mapStateModalToProps = (state: any) => {
  return {    
    modal: state.modalReducer
  }
}
const mapDispatchModalActionToProps = (dispatch: any) => {
  return {
    updateModal: (value: any) => dispatch(updateModal(value))
  }
}
export default connect(mapStateModalToProps,mapDispatchModalActionToProps)(TestContent)